import React from 'react';
import Modal from "../../Templates/Modal/Modal";


function ResetPassword({modalResetPassword,setModalResetPassword}) {
    const handleResetPassword = async () => {

        setModalResetPassword(false)

    }
    return (
        <div>
            <Modal active={modalResetPassword} setActive={setModalResetPassword}>
                <h1>Изменение информации:</h1>
                <hr/>
                <form className="modalLoginBox" onSubmit={handleResetPassword}>
                    <h2>Новый пароль будет: qwerty123</h2>
                    <button className="ModalButtonRePasswordUser" type="submit" >
                        Сбросить
                    </button>
                </form>
            </Modal>
        </div>
    );

}

export default ResetPassword;
